return {
    AddVatInv: function () {
        var entity = {
            StatusId: 1,
            ActionId: 2,
            VoucherTypeId: 11,
            InsertedBy: this.Token.UserId,
            FeeTypeId: 0,
            TypeId: 2,
            ObhTypeId: 1,
            PostDate: this.dayjs().format('YYYY-MM-DDTHH:mm:ss'),
            InvoiceDate: this.dayjs().format('YYYY-MM-DDTHH:mm:ss'),
            ExchangeRateINV: this.Decimal(1).div(this.Decimal(JSON.parse(localStorage.getItem("ExchangeRateUSD"))["VND"])),
        }
        this.OpenPopup("issue-invoice-editor", entity);
    },
    AddSOA: function () {
        var entity = {
            StatusId: this.SalesFunction["APPROVE_SOA"] ? 3 : 1,
            NoApproved: this.SalesFunction["APPROVE_SOA"] ? true : false,
            VoucherTypeId: 13,
            InsertedBy: this.Token.UserId,
            FeeTypeId: 0,
            TypeId: 4,
            ObhTypeId: 1,
            ActionId: 2,
            PostDate: this.dayjs().format('YYYY-MM-DDTHH:mm:ss'),
            InvoiceDate: this.dayjs().format('YYYY-MM-DDTHH:mm:ss')
        }
        this.OpenPopup("soa-editor", entity);
    },
    EditSOA: function (btn, entity) {
        this.OpenPopup("soa-editor", entity);
    },
    AddDebit: function () {
        var entity = {
            StatusId: 1,
            ActionId: 2,
            VoucherTypeId: 11,
            InsertedBy: this.Token.UserId,
            FeeTypeId: 0,
            TypeId: 2,
            ObhTypeId: 1,
            PostDate: this.dayjs().format('YYYY-MM-DDTHH:mm:ss'),
            InvoiceDate: this.dayjs().format('YYYY-MM-DDTHH:mm:ss'),
            ExchangeRateINV: this.Decimal(1).div(this.Decimal(JSON.parse(localStorage.getItem("ExchangeRateUSD"))["VND"])),
        }
        this.OpenPopup("issue-invoice-editor", entity);
    },
    EditDebit: function (btn, entity) {
        this.OpenPopup("issue-invoice-editor", { Id: entity.Id }, true);
    },
    EditInvoice: function (btn, entity) {
        this.OpenPopup("vatinvoice-editor", { Id: entity.Id }, true);
    },
    EditPayment: function (btn, entity) {
        this.OpenPopup("payment-request-editor", { Id: entity.Id }, true);
    }
}

